import React from 'react';
import ReactDOM from 'react-dom';
import "./App.css";

const myelement = (
	<div>
	  	<ul>
			<li>
		  		<a>Divide And Conquer</a>
			</li>
	  	</ul>
	</div>
);

function App() {
  	return(
		<h1>Hi there!</h1>
	);
}

ReactDOM.render(myelement, document.getElementById('root'));

export default App;
